const Login =() => {
    const heading = "Welcome to Login Page";
    return (
        <div classname = "Login_Layout">
            <h1> "Welcome to Login Page" </h1>
            <h1><b> Enter Your User Id</b></h1>
        </div>
    );

    
}
export default Login;
